INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (24, 1, '', '', 'FRONT', 'VUE2', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue2/src/views/${table.moduleName}/${table.businessName}/components/${subSimpleClassNames[subIndex]}List.vue', 'codegen/vue/views/components/list_sub_inner.vue.vm', '', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:24', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (25, 1, '', '', 'FRONT', 'VUE2', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue2/src/views/${table.moduleName}/${table.businessName}/components/${subSimpleClassNames[subIndex]}List.vue', 'codegen/vue/views/components/list_sub_erp.vue.vm', '', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:26', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (26, 1, 'vue3_index', 'vue3前端index', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/views/${table.moduleName}/${table.businessName}/index.vue', 'codegen/vue3/views/index.vue.vm', '<template>\n  <ContentWrap>\n    <!-- 搜索工作栏 -->\n    <el-form\n      class=\"-mb-15px\"\n      :model=\"queryParams\"\n      ref=\"queryFormRef\"\n      :inline=\"true\"\n      label-width=\"68px\"\n    >\n    #foreach($column in $columns)\n        #if ($column.listOperation)\n            #set ($dictType = $column.dictType)\n            #set ($javaField = $column.javaField)\n            #set ($javaType = $column.javaType)\n            #set ($AttrName = $column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n            #set ($comment = $column.columnComment)\n            #set ($dictMethod = \"getDictOptions\")## 计算使用哪个 dict 字典方法\n            #if ($javaType == \"Integer\" || $javaType == \"Long\" || $javaType == \"Byte\" || $javaType == \"Short\")\n                #set ($dictMethod = \"getIntDictOptions\")\n            #elseif ($javaType == \"String\")\n                #set ($dictMethod = \"getStrDictOptions\")\n            #elseif ($javaType == \"Boolean\")\n                #set ($dictMethod = \"getBoolDictOptions\")\n            #end\n            #if ($column.htmlType == \"input\")\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-input\n          v-model=\"queryParams.${javaField}\"\n          placeholder=\"请输入${comment}\"\n          clearable\n          @keyup.enter=\"handleQuery\"\n          class=\"!w-240px\"\n        />\n      </el-form-item>\n            #elseif ($column.htmlType == \"select\" || $column.htmlType == \"radio\")\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-select\n          v-model=\"queryParams.${javaField}\"\n          placeholder=\"请选择${comment}\"\n          clearable\n          class=\"!w-240px\"\n        >\n                #if (\"\" != $dictType)## 设置了 dictType 数据字典的情况\n          <el-option\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.label\"\n            :value=\"dict.value\"\n          />\n                #else## 未设置 dictType 数据字典的情况\n          <el-option label=\"请选择字典生成\" value=\"\" />\n                #end\n        </el-select>\n      </el-form-item>\n    #elseif($column.htmlType == \"datetime\")\n      #if ($column.listOperationCondition != \"BETWEEN\")## 非范围\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-date-picker\n          v-model=\"queryParams.${javaField}\"\n          value-format=\"YYYY-MM-DD\"\n          type=\"date\"\n          placeholder=\"选择${comment}\"\n          clearable\n          class=\"!w-240px\"\n        />\n      </el-form-item>\n      #else## 范围\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-date-picker\n          v-model=\"queryParams.${javaField}\"\n          value-format=\"YYYY-MM-DD HH:mm:ss\"\n          type=\"daterange\"\n          start-placeholder=\"开始日期\"\n          end-placeholder=\"结束日期\"\n          :default-time=\"[new Date(\'1 00:00:00\'), new Date(\'1 23:59:59\')]\"\n          class=\"!w-220px\"\n        />\n      </el-form-item>\n      #end\n    #end\n    #end\n    #end\n      <el-form-item>\n        <el-button @click=\"handleQuery\"><Icon icon=\"ep:search\" class=\"mr-5px\" /> 搜索</el-button>\n        <el-button @click=\"resetQuery\"><Icon icon=\"ep:refresh\" class=\"mr-5px\" /> 重置</el-button>\n        <el-button\n          type=\"primary\"\n          plain\n          @click=\"openForm(\'create\')\"\n          v-hasPermi=\"[\'${permissionPrefix}:create\']\"\n        >\n          <Icon icon=\"ep:plus\" class=\"mr-5px\" /> 新增\n        </el-button>\n        <el-button\n          type=\"success\"\n          plain\n          @click=\"handleExport\"\n          :loading=\"exportLoading\"\n          v-hasPermi=\"[\'${permissionPrefix}:export\']\"\n        >\n          <Icon icon=\"ep:download\" class=\"mr-5px\" /> 导出\n        </el-button>\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\n        <el-button type=\"danger\" plain @click=\"toggleExpandAll\">\n          <Icon icon=\"ep:sort\" class=\"mr-5px\" /> 展开/折叠\n        </el-button>\n#end\n      </el-form-item>\n    </el-form>\n  </ContentWrap>\n\n  <!-- 列表 -->\n  <ContentWrap>\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 11 && $subTables && $subTables.size() > 0 )\n    <el-table\n      v-loading=\"loading\"\n      :data=\"list\"\n      :stripe=\"true\"\n      :show-overflow-tooltip=\"true\"\n      highlight-current-row\n      @current-change=\"handleCurrentChange\"\n    >\n## 特殊：树表专属逻辑\n#elseif ( $table.templateType == 2 )\n    <el-table\n      v-loading=\"loading\"\n      :data=\"list\"\n      :stripe=\"true\"\n      :show-overflow-tooltip=\"true\"\n      row-key=\"id\"\n      :default-expand-all=\"isExpandAll\"\n      v-if=\"refreshTable\"\n    >\n#else\n    <el-table v-loading=\"loading\" :data=\"list\" :stripe=\"true\" :show-overflow-tooltip=\"true\">\n#end\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 12 && $subTables && $subTables.size() > 0 )\n      <!-- 子表的列表 -->\n      <el-table-column type=\"expand\">\n        <template #default=\"scope\">\n          <el-tabs model-value=\"$subClassNameVars.get(0)\">\n            #foreach ($subTable in $subTables)\n              #set ($index = $foreach.count - 1)\n              #set ($subClassNameVar = $subClassNameVars.get($index))\n              #set ($subSimpleClassName = $subSimpleClassNames.get($index))\n              #set ($subJoinColumn_strikeCase = $subJoinColumn_strikeCases.get($index))\n            <el-tab-pane label=\"${subTable.classComment}\" name=\"$subClassNameVar\">\n              <${subSimpleClassName}List :${subJoinColumn_strikeCase}=\"scope.row.id\" />\n            </el-tab-pane>\n            #end\n          </el-tabs>\n        </template>\n      </el-table-column>\n#end\n      #foreach($column in $columns)\n      #if ($column.listOperationResult)\n        #set ($dictType=$column.dictType)\n        #set ($javaField = $column.javaField)\n        #set ($AttrName=$column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n        #set ($comment=$column.columnComment)\n        #if ($column.javaType == \"LocalDateTime\")## 时间类型\n      <el-table-column\n        label=\"${comment}\"\n        align=\"center\"\n        prop=\"${javaField}\"\n        :formatter=\"dateFormatter\"\n        width=\"180px\"\n      />\n        #elseif($column.dictType && \"\" != $column.dictType)## 数据字典\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\">\n        <template #default=\"scope\">\n          <dict-tag :type=\"DICT_TYPE.$dictType.toUpperCase()\" :value=\"scope.row.${column.javaField}\" />\n        </template>\n      </el-table-column>\n        #else\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\" />\n        #end\n      #end\n    #end\n      <el-table-column label=\"操作\" align=\"center\" min-width=\"120px\">\n        <template #default=\"scope\">\n          <el-button\n            link\n            type=\"primary\"\n            @click=\"openForm(\'update\', scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:update\']\"\n          >\n            编辑\n          </el-button>\n          <el-button\n            link\n            type=\"danger\"\n            @click=\"handleDelete(scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:delete\']\"\n          >\n            删除\n          </el-button>\n        </template>\n      </el-table-column>\n    </el-table>\n    <!-- 分页 -->\n    <Pagination\n      :total=\"total\"\n      v-model:page=\"queryParams.pageNo\"\n      v-model:limit=\"queryParams.pageSize\"\n      @pagination=\"getList\"\n    />\n  </ContentWrap>\n\n  <!-- 表单弹窗：添加/修改 -->\n  <${simpleClassName}Form ref=\"formRef\" @success=\"getList\" />\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 11 && $subTables && $subTables.size() > 0 )\n  <!-- 子表的列表 -->\n  <ContentWrap>\n    <el-tabs model-value=\"$subClassNameVars.get(0)\">\n      #foreach ($subTable in $subTables)\n        #set ($index = $foreach.count - 1)\n        #set ($subClassNameVar = $subClassNameVars.get($index))\n        #set ($subSimpleClassName = $subSimpleClassNames.get($index))\n        #set ($subJoinColumn_strikeCase = $subJoinColumn_strikeCases.get($index))\n      <el-tab-pane label=\"${subTable.classComment}\" name=\"$subClassNameVar\">\n        <${subSimpleClassName}List :${subJoinColumn_strikeCase}=\"currentRow.id\" />\n      </el-tab-pane>\n      #end\n    </el-tabs>\n  </ContentWrap>\n#end\n</template>\n\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { dateFormatter } from \'@/utils/formatTime\'\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\nimport { handleTree } from \'@/utils/tree\'\n#end\nimport download from \'@/utils/download\'\nimport { ${simpleClassName}Api, ${simpleClassName}VO } from \'@/api/${table.moduleName}/${table.businessName}\'\nimport ${simpleClassName}Form from \'./${simpleClassName}Form.vue\'\n## 特殊：主子表专属逻辑\n#if ( $table.templateType != 10 )\n#foreach ($subSimpleClassName in $subSimpleClassNames)\nimport ${subSimpleClassName}List from \'./components/${subSimpleClassName}List.vue\'\n#end\n#end\n\n/** ${table.classComment} 列表 */\ndefineOptions({ name: \'${table.className}\' })\n\nconst message = useMessage() // 消息弹窗\nconst { t } = useI18n() // 国际化\n\nconst loading = ref(true) // 列表的加载中\nconst list = ref<${simpleClassName}VO[]>([]) // 列表的数据\n## 特殊：树表专属逻辑（树不需要分页接口）\n#if ( $table.templateType != 2 )\nconst total = ref(0) // 列表的总页数\n#end\nconst queryParams = reactive({\n## 特殊：树表专属逻辑（树不需要分页接口）\n#if ( $table.templateType != 2 )\n  pageNo: 1,\n  pageSize: 10,\n#end\n  #foreach ($column in $columns)\n    #if ($column.listOperation)\n      #if ($column.listOperationCondition != \'BETWEEN\')\n  $column.javaField: undefined,\n  #end\n      #if ($column.htmlType == \"datetime\" || $column.listOperationCondition == \"BETWEEN\")\n  $column.javaField: [],\n      #end\n    #end\n  #end\n})\nconst queryFormRef = ref() // 搜索的表单\nconst exportLoading = ref(false) // 导出的加载中\n\n/** 查询列表 */\nconst getList = async () => {\n  loading.value = true\n  try {\n## 特殊：树表专属逻辑（树不需要分页接口）\n  #if ( $table.templateType == 2 )\n    const data = await ${simpleClassName}Api.get${simpleClassName}List(queryParams)\n    list.value = handleTree(data, \'id\', \'${treeParentColumn.javaField}\')\n  #else\n    const data = await ${simpleClassName}Api.get${simpleClassName}Page(queryParams)\n    list.value = data.list\n    total.value = data.total\n  #end\n  } finally {\n    loading.value = false\n  }\n}\n\n/** 搜索按钮操作 */\nconst handleQuery = () => {\n  queryParams.pageNo = 1\n  getList()\n}\n\n/** 重置按钮操作 */\nconst resetQuery = () => {\n  queryFormRef.value.resetFields()\n  handleQuery()\n}\n\n/** 添加/修改操作 */\nconst formRef = ref()\nconst openForm = (type: string, id?: number) => {\n  formRef.value.open(type, id)\n}\n\n/** 删除按钮操作 */\nconst handleDelete = async (id: number) => {\n  try {\n    // 删除的二次确认\n    await message.delConfirm()\n    // 发起删除\n    await ${simpleClassName}Api.delete${simpleClassName}(id)\n    message.success(t(\'common.delSuccess\'))\n    // 刷新列表\n    await getList()\n  } catch {}\n}\n\n/** 导出按钮操作 */\nconst handleExport = async () => {\n  try {\n    // 导出的二次确认\n    await message.exportConfirm()\n    // 发起导出\n    exportLoading.value = true\n    const data = await ${simpleClassName}Api.export${simpleClassName}(queryParams)\n    download.excel(data, \'${table.classComment}.xls\')\n  } catch {\n  } finally {\n    exportLoading.value = false\n  }\n}\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 11 )\n\n/** 选中行操作 */\nconst currentRow = ref({}) // 选中行\nconst handleCurrentChange = (row) => {\n  currentRow.value = row\n}\n#end\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\n\n/** 展开/折叠操作 */\nconst isExpandAll = ref(true) // 是否展开，默认全部展开\nconst refreshTable = ref(true) // 重新渲染表格状态\nconst toggleExpandAll = async () => {\n  refreshTable.value = false\n  isExpandAll.value = !isExpandAll.value\n  await nextTick()\n  refreshTable.value = true\n}\n#end\n\n/** 初始化 **/\nonMounted(() => {\n  getList()\n})\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-15 11:42:36', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (27, 1, 'vue3_form', 'vue3的前端弹出表单，用于新增修改', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/views/${table.moduleName}/${table.businessName}/${simpleClassName}Form.vue', 'codegen/vue3/views/form.vue.vm', '<template>\n  <Dialog :title=\"dialogTitle\" v-model=\"dialogVisible\">\n    <el-form\n      ref=\"formRef\"\n      :model=\"formData\"\n      :rules=\"formRules\"\n      label-width=\"100px\"\n      v-loading=\"formLoading\"\n    >\n#foreach($column in $columns)\n    #if ($column.createOperation || $column.updateOperation)\n        #set ($dictType = $column.dictType)\n        #set ($javaField = $column.javaField)\n        #set ($javaType = $column.javaType)\n        #set ($AttrName = $column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n        #set ($comment = $column.columnComment)\n        #set ($dictMethod = \"getDictOptions\")## 计算使用哪个 dict 字典方法\n        #if ($javaType == \"Integer\" || $javaType == \"Long\" || $javaType == \"Byte\" || $javaType == \"Short\")\n            #set ($dictMethod = \"getIntDictOptions\")\n        #elseif ($javaType == \"String\")\n            #set ($dictMethod = \"getStrDictOptions\")\n        #elseif ($javaType == \"Boolean\")\n            #set ($dictMethod = \"getBoolDictOptions\")\n        #end\n        #if ( $table.templateType == 2 && $column.id == $treeParentColumn.id )\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-tree-select\n          v-model=\"formData.${javaField}\"\n          :data=\"${classNameVar}Tree\"\n          #if ($treeNameColumn.javaField == \"name\")\n          :props=\"defaultProps\"\n          #else\n          :props=\"{...defaultProps, label: \'$treeNameColumn.javaField\'}\"\n          #end\n          check-strictly\n          default-expand-all\n          placeholder=\"请选择${comment}\"\n        />\n      </el-form-item>\n        #elseif ($column.htmlType == \"input\" && !$column.primaryKey)## 忽略主键，不用在表单里\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-input v-model=\"formData.${javaField}\" placeholder=\"请输入${comment}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"imageUpload\")## 图片上传\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <UploadImg v-model=\"formData.${javaField}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"fileUpload\")## 文件上传\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <UploadFile v-model=\"formData.${javaField}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"editor\")## 文本编辑器\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <Editor v-model=\"formData.${javaField}\" height=\"150px\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"select\")## 下拉框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-select v-model=\"formData.${javaField}\" placeholder=\"请选择${comment}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-option\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.label\"\n            :value=\"dict.value\"\n          />\n                #else##没数据字典\n          <el-option label=\"请选择字典生成\" value=\"\" />\n                #end\n        </el-select>\n      </el-form-item>\n        #elseif($column.htmlType == \"checkbox\")## 多选框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-checkbox-group v-model=\"formData.${javaField}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-checkbox\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.label\"\n            :value=\"dict.value\"\n          />\n                #else##没数据字典\n          <el-checkbox label=\"请选择字典生成\" />\n                #end\n        </el-checkbox-group>\n      </el-form-item>\n        #elseif($column.htmlType == \"radio\")## 单选框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-radio-group v-model=\"formData.${javaField}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-radio\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.value\"\n          >\n            {{ dict.label }}\n          </el-radio>\n                #else##没数据字典\n          <el-radio value=\"1\">请选择字典生成</el-radio>\n                #end\n        </el-radio-group>\n      </el-form-item>\n        #elseif($column.htmlType == \"datetime\")## 时间框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-date-picker\n          v-model=\"formData.${javaField}\"\n          type=\"date\"\n          value-format=\"x\"\n          placeholder=\"选择${comment}\"\n        />\n      </el-form-item>\n        #elseif($column.htmlType == \"textarea\")## 文本框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-input v-model=\"formData.${javaField}\" type=\"textarea\" placeholder=\"请输入${comment}\" />\n      </el-form-item>\n        #end\n    #end\n#end\n    </el-form>\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 10 || $table.templateType == 12 )\n    <!-- 子表的表单 -->\n    <el-tabs v-model=\"subTabsName\">\n    #foreach ($subTable in $subTables)\n      #set ($index = $foreach.count - 1)\n      #set ($subClassNameVar = $subClassNameVars.get($index))\n      #set ($subSimpleClassName = $subSimpleClassNames.get($index))\n      #set ($subJoinColumn_strikeCase = $subJoinColumn_strikeCases.get($index))\n      <el-tab-pane label=\"${subTable.classComment}\" name=\"$subClassNameVar\">\n        <${subSimpleClassName}Form ref=\"${subClassNameVar}FormRef\" :${subJoinColumn_strikeCase}=\"formData.id\" />\n      </el-tab-pane>\n    #end\n    </el-tabs>\n#end\n    <template #footer>\n      <el-button @click=\"submitForm\" type=\"primary\" :disabled=\"formLoading\">确 定</el-button>\n      <el-button @click=\"dialogVisible = false\">取 消</el-button>\n    </template>\n  </Dialog>\n</template>\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { ${simpleClassName}Api, ${simpleClassName}VO } from \'@/api/${table.moduleName}/${table.businessName}\'\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\nimport { defaultProps, handleTree } from \'@/utils/tree\'\n#end\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 10 || $table.templateType == 12 )\n#foreach ($subSimpleClassName in $subSimpleClassNames)\nimport ${subSimpleClassName}Form from \'./components/${subSimpleClassName}Form.vue\'\n#end\n#end\n\n/** ${table.classComment} 表单 */\ndefineOptions({ name: \'${simpleClassName}Form\' })\n\nconst { t } = useI18n() // 国际化\nconst message = useMessage() // 消息弹窗\n\nconst dialogVisible = ref(false) // 弹窗的是否展示\nconst dialogTitle = ref(\'\') // 弹窗的标题\nconst formLoading = ref(false) // 表单的加载中：1）修改时的数据加载；2）提交的按钮禁用\nconst formType = ref(\'\') // 表单的类型：create - 新增；update - 修改\nconst formData = ref({\n#foreach ($column in $columns)\n    #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n  $column.javaField: [],\n      #else\n  $column.javaField: undefined,\n      #end\n    #end\n#end\n})\nconst formRules = reactive({\n#foreach ($column in $columns)\n    #if (($column.createOperation || $column.updateOperation) && !$column.nullable && !${column.primaryKey})## 创建或者更新操作 && 要求非空 && 非主键\n        #set($comment=$column.columnComment)\n  $column.javaField: [{ required: true, message: \'${comment}不能为空\', trigger: #if($column.htmlType == \'select\')\'change\'#else\'blur\'#end }],\n    #end\n#end\n})\nconst formRef = ref() // 表单 Ref\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\nconst ${classNameVar}Tree = ref() // 树形结构\n#end\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 10 || $table.templateType == 12 )\n#if ( $subTables && $subTables.size() > 0 )\n\n/** 子表的表单 */\nconst subTabsName = ref(\'$subClassNameVars.get(0)\')\n#foreach ($subClassNameVar in $subClassNameVars)\nconst ${subClassNameVar}FormRef = ref()\n#end\n#end\n#end\n\n/** 打开弹窗 */\nconst open = async (type: string, id?: number) => {\n  dialogVisible.value = true\n  dialogTitle.value = t(\'action.\' + type)\n  formType.value = type\n  resetForm()\n  // 修改时，设置数据\n  if (id) {\n    formLoading.value = true\n    try {\n      formData.value = await ${simpleClassName}Api.get${simpleClassName}(id)\n    } finally {\n      formLoading.value = false\n    }\n  }\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\n  await get${simpleClassName}Tree()\n#end\n}\ndefineExpose({ open }) // 提供 open 方法，用于打开弹窗\n\n/** 提交表单 */\nconst emit = defineEmits([\'success\']) // 定义 success 事件，用于操作成功后的回调\nconst submitForm = async () => {\n  // 校验表单\n  await formRef.value.validate()\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 10 || $table.templateType == 12 )\n#if ( $subTables && $subTables.size() > 0 )\n  // 校验子表单\n  #foreach ($subTable in $subTables)\n  #set ($index = $foreach.count - 1)\n  #set ($subClassNameVar = $subClassNameVars.get($index))\n  try {\n    await ${subClassNameVar}FormRef.value.validate()\n  } catch (e) {\n    subTabsName.value = \'${subClassNameVar}\'\n    return\n  }\n  #end\n#end\n#end\n  // 提交请求\n  formLoading.value = true\n  try {\n    const data = formData.value as unknown as ${simpleClassName}VO\n## 特殊：主子表专属逻辑\n#if ( $table.templateType == 10 || $table.templateType == 12 )\n#if ( $subTables && $subTables.size() > 0 )\n    // 拼接子表的数据\n  #foreach ($subTable in $subTables)\n  #set ($index = $foreach.count - 1)\n  #set ($subClassNameVar = $subClassNameVars.get($index))\n    data.${subClassNameVar}#if ( $subTable.subJoinMany)s#end = ${subClassNameVar}FormRef.value.getData()\n  #end\n#end\n#end\n    if (formType.value === \'create\') {\n      await ${simpleClassName}Api.create${simpleClassName}(data)\n      message.success(t(\'common.createSuccess\'))\n    } else {\n      await ${simpleClassName}Api.update${simpleClassName}(data)\n      message.success(t(\'common.updateSuccess\'))\n    }\n    dialogVisible.value = false\n    // 发送操作成功的事件\n    emit(\'success\')\n  } finally {\n    formLoading.value = false\n  }\n}\n\n/** 重置表单 */\nconst resetForm = () => {\n  formData.value = {\n#foreach ($column in $columns)\n  #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n    $column.javaField: [],\n      #else\n    $column.javaField: undefined,\n      #end\n  #end\n#end\n  }\n  formRef.value?.resetFields()\n}\n## 特殊：树表专属逻辑\n#if ( $table.templateType == 2 )\n\n/** 获得${table.classComment}树 */\nconst get${simpleClassName}Tree = async () => {\n  ${classNameVar}Tree.value = []\n  const data = await ${simpleClassName}Api.get${simpleClassName}List()\n  const root: Tree = { id: 0, name: \'顶级${table.classComment}\', children: [] }\n  root.children = handleTree(data, \'id\', \'${treeParentColumn.javaField}\')\n  ${classNameVar}Tree.value.push(root)\n}\n#end\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-15 11:43:13', b'0');
