e}By${SubJoinColumnName}(val)\n      if (!data) {\n        return\n      }\n      formData.value = data\n#end\n    } finally {\n      formLoading.value = false\n    }\n  },\n  { immediate: true }\n)\n#if ( $subTable.subJoinMany )\n\n/** 新增按钮操作 */\nconst handleAdd = () => {\n  const row = {\n#foreach ($column in $subColumns)\n    #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n    $column.javaField: [],\n      #else\n    $column.javaField: undefined,\n      #end\n  #end\n#end\n  }\n  row.${subJoinColumn.javaField} = props.${subJoinColumn.javaField}\n  formData.value.push(row)\n}\n\n/** 删除按钮操作 */\nconst handleDelete = (index) => {\n  formData.value.splice(index, 1)\n}\n#end\n\n/** 表单校验 */\nconst validate = () => {\n  return formRef.value.validate()\n}\n\n/** 表单值 */\nconst getData = () => {\n  return formData.value\n}\n\ndefineExpose({ validate, getData })\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:30', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (30, 1, 'vue3_form_sub_erp', 'vue3 erp实现', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/views/${table.moduleName}/${table.businessName}/components/${subSimpleClassNames[subIndex]}Form.vue', 'codegen/vue3/views/components/form_sub_erp.vue.vm', '#set ($subColumns = $subColumnsList.get($subIndex))##当前字段数组\n#set ($subSimpleClassName = $subSimpleClassNames.get($subIndex))\n#set ($subJoinColumn = $subJoinColumns.get($subIndex))##当前 join 字段\n<template>\n  <Dialog :title=\"dialogTitle\" v-model=\"dialogVisible\">\n    <el-form\n      ref=\"formRef\"\n      :model=\"formData\"\n      :rules=\"formRules\"\n      label-width=\"100px\"\n      v-loading=\"formLoading\"\n    >\n#foreach($column in $subColumns)\n    #if ($column.createOperation || $column.updateOperation)\n        #set ($dictType = $column.dictType)\n        #set ($javaField = $column.javaField)\n        #set ($javaType = $column.javaType)\n        #set ($AttrName = $column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n        #set ($comment = $column.columnComment)\n        #set ($dictMethod = \"getDictOptions\")## 计算使用哪个 dict 字典方法\n        #if ($javaType == \"Integer\" || $javaType == \"Long\" || $javaType == \"Byte\" || $javaType == \"Short\")\n            #set ($dictMethod = \"getIntDictOptions\")\n        #elseif ($javaType == \"String\")\n            #set ($dictMethod = \"getStrDictOptions\")\n        #elseif ($javaType == \"Boolean\")\n            #set ($dictMethod = \"getBoolDictOptions\")\n        #end\n        #if ( $column.id == $subJoinColumn.id) ## 特殊：忽略主子表的 join 字段，不用填写\n        #elseif ($column.htmlType == \"input\" && !$column.primaryKey)## 忽略主键，不用在表单里\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-input v-model=\"formData.${javaField}\" placeholder=\"请输入${comment}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"imageUpload\")## 图片上传\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <UploadImg v-model=\"formData.${javaField}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"fileUpload\")## 文件上传\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <UploadFile v-model=\"formData.${javaField}\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"editor\")## 文本编辑器\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <Editor v-model=\"formData.${javaField}\" height=\"150px\" />\n      </el-form-item>\n        #elseif($column.htmlType == \"select\")## 下拉框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-select v-model=\"formData.${javaField}\" placeholder=\"请选择${comment}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-option\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.label\"\n            :value=\"dict.value\"\n          />\n                #else##没数据字典\n          <el-option label=\"请选择字典生成\" value=\"\" />\n                #end\n        </el-select>\n      </el-form-item>\n        #elseif($column.htmlType == \"checkbox\")## 多选框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-checkbox-group v-model=\"formData.${javaField}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-checkbox\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.label\"\n            :value=\"dict.value\"\n          />\n                #else##没数据字典\n          <el-checkbox label=\"请选择字典生成\" />\n                #end\n        </el-checkbox-group>\n      </el-form-item>\n        #elseif($column.htmlType == \"radio\")## 单选框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-radio-group v-model=\"formData.${javaField}\">\n                #if (\"\" != $dictType)## 有数据字典\n          <el-radio\n            v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n            :key=\"dict.value\"\n            :label=\"dict.value\"\n          >\n            {{ dict.label }}\n          </el-radio>\n                #else##没数据字典\n          <el-radio value=\"1\">请选择字典生成</el-radio>\n                #end\n        </el-radio-group>\n      </el-form-item>\n        #elseif($column.htmlType == \"datetime\")## 时间框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-date-picker\n          v-model=\"formData.${javaField}\"\n          type=\"date\"\n          value-format=\"x\"\n          placeholder=\"选择${comment}\"\n        />\n      </el-form-item>\n        #elseif($column.htmlType == \"textarea\")## 文本框\n      <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n        <el-input v-model=\"formData.${javaField}\" type=\"textarea\" placeholder=\"请输入${comment}\" />\n      </el-form-item>\n        #end\n    #end\n#end\n    </el-form>\n    <template #footer>\n      <el-button @click=\"submitForm\" type=\"primary\" :disabled=\"formLoading\">确 定</el-button>\n      <el-button @click=\"dialogVisible = false\">取 消</el-button>\n    </template>\n  </Dialog>\n</template>\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { ${simpleClassName}Api } from \'@/api/${table.moduleName}/${table.businessName}\'\n\nconst { t } = useI18n() // 国际化\nconst message = useMessage() // 消息弹窗\n\nconst dialogVisible = ref(false) // 弹窗的是否展示\nconst dialogTitle = ref(\'\') // 弹窗的标题\nconst formLoading = ref(false) // 表单的加载中：1）修改时的数据加载；2）提交的按钮禁用\nconst formType = ref(\'\') // 表单的类型：create - 新增；update - 修改\nconst formData = ref({\n#foreach ($column in $subColumns)\n    #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n  $column.javaField: [],\n      #else\n  $column.javaField: undefined,\n      #end\n    #end\n#end\n})\nconst formRules = reactive({\n#foreach ($column in $subColumns)\n    #if (($column.createOperation || $column.updateOperation) && !$column.nullable && !${column.primaryKey})## 创建或者更新操作 && 要求非空 && 非主键\n        #set($comment=$column.columnComment)\n  $column.javaField: [{ required: true, message: \'${comment}不能为空\', trigger: #if($column.htmlType == \'select\')\'change\'#else\'blur\'#end }],\n    #end\n#end\n})\nconst formRef = ref() // 表单 Ref\n\n/** 打开弹窗 */\nconst open = async (type: string, id?: number, ${subJoinColumn.javaField}: number) => {\n  dialogVisible.value = true\n  dialogTitle.value = t(\'action.\' + type)\n  formType.value = type\n  resetForm()\n  formData.value.${subJoinColumn.javaField} = ${subJoinColumn.javaField}\n  // 修改时，设置数据\n  if (id) {\n    formLoading.value = true\n    try {\n      formData.value = await ${simpleClassName}Api.get${subSimpleClassName}(id)\n    } finally {\n      formLoading.value = false\n    }\n  }\n}\ndefineExpose({ open }) // 提供 open 方法，用于打开弹窗\n\n/** 提交表单 */\nconst emit = defineEmits([\'success\']) // 定义 success 事件，用于操作成功后的回调\nconst submitForm = async () => {\n  // 校验表单\n  await formRef.value.validate()\n  // 提交请求\n  formLoading.value = true\n  try {\n    const data = formData.value\n    if (formType.value === \'create\') {\n      await ${simpleClassName}Api.create${subSimpleClassName}(data)\n      message.success(t(\'common.createSuccess\'))\n    } else {\n      await ${simpleClassName}Api.update${subSimpleClassName}(data)\n      message.success(t(\'common.updateSuccess\'))\n    }\n    dialogVisible.value = false\n    // 发送操作成功的事件\n    emit(\'success\')\n  } finally {\n    formLoading.value = false\n  }\n}\n\n/** 重置表单 */\nconst resetForm = () => {\n  formData.value = {\n#foreach ($column in $subColumns)\n  #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n    $column.javaField: [],\n      #else\n    $column.javaField: undefined,\n      #end\n  #end\n#end\n  }\n  formRef.value?.resetFields()\n}\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:32', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (31, 1, 'vue3_list_sub_inner.vue', 'vue3内嵌list实现', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/views/${table.moduleName}/${table.businessName}/components/${subSimpleClassNames[subIndex]}List.vue', 'codegen/vue3/views/components/list_sub_inner.vue.vm', '#set ($subTable = $subTables.get($subIndex))##当前表\n#set ($subColumns = $subColumnsList.get($subIndex))##当前字段数组\n#set ($subJoinColumn = $subJoinColumns.get($subIndex))##当前 join 字段\n#set ($subSimpleClassName = $subSimpleClassNames.get($subIndex))\n#set ($subJoinColumn = $subJoinColumns.get($subIndex))##当前 join 字段\n#set ($SubJoinColumnName = $subJoinColumn.javaField.substring(0,1).toUpperCase() + ${subJoinColumn.javaField.substring(1)})##首字母大写\n<template>\n  <!-- 列表 -->\n  <ContentWrap>\n#if ($table.templateType == 11)\n    <el-button\n      type=\"primary\"\n      plain\n      @click=\"openForm(\'create\')\"\n      v-hasPermi=\"[\'${permissionPrefix}:create\']\"\n    >\n      <Icon icon=\"ep:plus\" class=\"mr-5px\" /> 新增\n    </el-button>\n#end\n    <el-table v-loading=\"loading\" :data=\"list\" :stripe=\"true\" :show-overflow-tooltip=\"true\">\n      #foreach($column in $subColumns)\n      #if ($column.listOperationResult)\n        #set ($dictType=$column.dictType)\n        #set ($javaField = $column.javaField)\n        #set ($AttrName=$column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n        #set ($comment=$column.columnComment)\n        #if ( $column.id == $subJoinColumn.id) ## 特殊：忽略主子表的 join 字段，不用填写\n        #elseif ($column.javaType == \"LocalDateTime\")## 时间类型\n      <el-table-column\n        label=\"${comment}\"\n        align=\"center\"\n        prop=\"${javaField}\"\n        :formatter=\"dateFormatter\"\n        width=\"180px\"\n      />\n        #elseif($column.dictType && \"\" != $column.dictType)## 数据字典\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\">\n        <template #default=\"scope\">\n          <dict-tag :type=\"DICT_TYPE.$dictType.toUpperCase()\" :value=\"scope.row.${column.javaField}\" />\n        </template>\n      </el-table-column>\n        #else\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\" />\n        #end\n      #end\n    #end\n    #if ($table.templateType == 11)\n      <el-table-column label=\"操作\" align=\"center\">\n        <template #default=\"scope\">\n          <el-button\n            link\n            type=\"primary\"\n            @click=\"openForm(\'update\', scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:update\']\"\n          >\n            编辑\n          </el-button>\n          <el-button\n            link\n            type=\"danger\"\n            @click=\"handleDelete(scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:delete\']\"\n          >\n            删除\n          </el-button>\n        </template>\n      </el-table-column>\n    #end\n    </el-table>\n    #if ($table.templateType == 11)\n    <!-- 分页 -->\n    <Pagination\n      :total=\"total\"\n      v-model:page=\"queryParams.pageNo\"\n      v-model:limit=\"queryParams.pageSize\"\n      @pagination=\"getList\"\n    />\n    #end\n  </ContentWrap>\n#if ($table.templateType == 11)\n    <!-- 表单弹窗：添加/修改 -->\n    <${subSimpleClassName}Form ref=\"formRef\" @success=\"getList\" />\n#end\n</template>\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { dateFormatter } from \'@/utils/formatTime\'\nimport { ${simpleClassName}Api } from \'@/api/${table.moduleName}/${table.businessName}\'\n#if ($table.templateType == 11)\nimport ${subSimpleClassName}Form from \'./${subSimpleClassName}Form.vue\'\n#end\n\nconst { t } = useI18n() // 国际化\nconst message = useMessage() // 消息弹窗\n\nconst props = defineProps<{\n  ${subJoinColumn.javaField}?: number // ${subJoinColumn.columnComment}（主表的关联字段）\n}>()\nconst loading = ref(false) // 列表的加载中\nconst list = ref([]) // 列表的数据\n#if ($table.templateType == 11)\nconst total = ref(0) // 列表的总页数\nconst queryParams = reactive({\n  pageNo: 1,\n  pageSize: 10,\n  ${subJoinColumn.javaField}: undefined as unknown\n})\n\n/** 监听主表的关联字段的变化，加载对应的子表数据 */\nwatch(\n  () => props.${subJoinColumn.javaField},\n  (val: number) => {\n    if (!val) {\n      return\n    }\n    queryParams.${subJoinColumn.javaField} = val\n    handleQuery()\n  },\n    { immediate: true, deep: true }\n)\n#end\n\n/** 查询列表 */\nconst getList = async () => {\n  loading.value = true\n  try {\n#if ($table.templateType == 11)\n    const data = await ${simpleClassName}Api.get${subSimpleClassName}Page(queryParams)\n    list.value = data.list\n    total.value = data.total\n#else\n  #if ( $subTable.subJoinMany )\n    list.value = await ${simpleClassName}Api.get${subSimpleClassName}ListBy${SubJoinColumnName}(props.${subJoinColumn.javaField})\n  #else\n    const data = await ${simpleClassName}Api.get${subSimpleClassName}By${SubJoinColumnName}(props.${subJoinColumn.javaField})\n    if (!data) {\n      return\n    }\n    list.value.push(data)\n  #end\n#end\n  } finally {\n    loading.value = false\n  }\n}\n\n/** 搜索按钮操作 */\nconst handleQuery = () => {\n  queryParams.pageNo = 1\n  getList()\n}\n#if ($table.templateType == 11)\n\n/** 添加/修改操作 */\nconst formRef = ref()\nconst openForm = (type: string, id?: number) => {\n  if (!props.${subJoinColumn.javaField}) {\n    message.error(\'请选择一个${table.classComment}\')\n    return\n  }\n  formRef.value.open(type, id, props.${subJoinColumn.javaField})\n}\n\n/** 删除按钮操作 */\nconst handleDelete = async (id: number) => {\n  try {\n    // 删除的二次确认\n    await message.delConfirm()\n    // 发起删除\n    await ${simpleClassName}Api.delete${subSimpleClassName}(id)\n    message.success(t(\'common.delSuccess\'))\n    // 刷新列表\n    await getList()\n  } catch {}\n}\n#end\n#if ($table.templateType != 11)\n\n/** 初始化 **/\nonMounted(() => {\n  getList()\n})\n#end\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:34', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (32, 1, 'vue3_ list_sub_erp.vue', 'vue3list子表erp实现', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/views/${table.moduleName}/${table.businessName}/components/${subSimpleClassNames[subIndex]}List.vue', 'codegen/vue3/views/components/list_sub_erp.vue.vm', '#set ($subTable = $subTables.get($subIndex))##当前表\n#set ($subColumns = $subColumnsList.get($subIndex))##当前字段数组\n#set ($subJoinColumn = $subJoinColumns.get($subIndex))##当前 join 字段\n#set ($subSimpleClassName = $subSimpleClassNames.get($subIndex))\n#set ($subJoinColumn = $subJoinColumns.get($subIndex))##当前 join 字段\n#set ($SubJoinColumnName = $subJoinColumn.javaField.substring(0,1).toUpperCase() + ${subJoinColumn.javaField.substring(1)})##首字母大写\n<template>\n  <!-- 列表 -->\n  <ContentWrap>\n#if ($table.templateType == 11)\n    <el-button\n      type=\"primary\"\n      plain\n      @click=\"openForm(\'create\')\"\n      v-hasPermi=\"[\'${permissionPrefix}:create\']\"\n    >\n      <Icon icon=\"ep:plus\" class=\"mr-5px\" /> 新增\n    </el-button>\n#end\n    <el-table v-loading=\"loading\" :data=\"list\" :stripe=\"true\" :show-overflow-tooltip=\"true\">\n      #foreach($column in $subColumns)\n      #if ($column.listOperationResult)\n        #set ($dictType=$column.dictType)\n        #set ($javaField = $column.javaField)\n        #set ($AttrName=$column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n        #set ($comment=$column.columnComment)\n        #if ( $column.id == $subJoinColumn.id) ## 特殊：忽略主子表的 join 字段，不用填写\n        #elseif ($column.javaType == \"LocalDateTime\")## 时间类型\n      <el-table-column\n        label=\"${comment}\"\n        align=\"center\"\n        prop=\"${javaField}\"\n        :formatter=\"dateFormatter\"\n        width=\"180px\"\n      />\n        #elseif($column.dictType && \"\" != $column.dictType)## 数据字典\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\">\n        <template #default=\"scope\">\n          <dict-tag :type=\"DICT_TYPE.$dictType.toUpperCase()\" :value=\"scope.row.${column.javaField}\" />\n        </template>\n      </el-table-column>\n        #else\n      <el-table-column label=\"${comment}\" align=\"center\" prop=\"${javaField}\" />\n        #end\n      #end\n    #end\n    #if ($table.templateType == 11)\n      <el-table-column label=\"操作\" align=\"center\">\n        <template #default=\"scope\">\n          <el-button\n            link\n            type=\"primary\"\n            @click=\"openForm(\'update\', scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:update\']\"\n          >\n            编辑\n          </el-button>\n          <el-button\n            link\n            type=\"danger\"\n            @click=\"handleDelete(scope.row.id)\"\n            v-hasPermi=\"[\'${permissionPrefix}:delete\']\"\n          >\n            删除\n          </el-button>\n        </template>\n      </el-table-column>\n    #end\n    </el-table>\n    #if ($table.templateType == 11)\n    <!-- 分页 -->\n    <Pagination\n      :total=\"total\"\n      v-model:page=\"queryParams.pageNo\"\n      v-model:limit=\"queryParams.pageSize\"\n      @pagination=\"getList\"\n    />\n    #end\n  </ContentWrap>\n#if ($table.templateType == 11)\n    <!-- 表单弹窗：添加/修改 -->\n    <${subSimpleClassName}Form ref=\"formRef\" @success=\"getList\" />\n#end\n</template>\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { dateFormatter } from \'@/utils/formatTime\'\nimport { ${simpleClassName}Api } from \'@/api/${table.moduleName}/${table.businessName}\'\n#if ($table.templateType == 11)\nimport ${subSimpleClassName}Form from \'./${subSimpleClassName}Form.vue\'\n#end\n\nconst { t } = useI18n() // 国际化\nconst message = useMessage() // 消息弹窗\n\nconst props = defineProps<{\n  ${subJoinColumn.javaField}?: number // ${subJoinColumn.columnComment}（主表的关联字段）\n}>()\nconst loading = ref(false) // 列表的加载中\nconst list = ref([]) // 列表的数据\n#if ($table.templateType == 11)\nconst total = ref(0) // 列表的总页数\nconst queryParams = reactive({\n  pageNo: 1,\n  pageSize: 10,\n  ${subJoinColumn.javaField}: undefined as unknown\n})\n\n/** 监听主表的关联字段的变化，加载对应的子表数据 */\nwatch(\n  () => props.${subJoinColumn.javaField},\n  (val: number) => {\n    if (!val) {\n      return\n    }\n    queryParams.${subJoinColumn.javaField} = val\n    handleQuery()\n  },\n    { immediate: true, deep: true }\n)\n#end\n\n/** 查询列表 */\nconst getList = async () => {\n  loading.value = true\n  try {\n#if ($table.templateType == 11)\n    const data = await ${simpleClassName}Api.get${subSimpleClassName}Page(queryParams)\n    list.value = data.list\n    total.value = data.total\n#else\n  #if ( $subTable.subJoinMany )\n    list.value = await ${simpleClassName}Api.get${subSimpleClassName}ListBy${SubJoinColumnName}(props.${subJoinColumn.javaField})\n  #else\n    const data = await ${simpleClassName}Api.get${subSimpleClassName}By${SubJoinColumnName}(props.${subJoinColumn.javaField})\n    if (!data) {\n      return\n    }\n    list.value.push(data)\n  #end\n#end\n  } finally {\n    loading.value = false\n  }\n}\n\n/** 搜索按钮操作 */\nconst handleQuery = () => {\n  queryParams.pageNo = 1\n  getList()\n}\n#if ($table.templateType == 11)\n\n/** 添加/修改操作 */\nconst formRef = ref()\nconst openForm = (type: string, id?: number) => {\n  if (!props.${subJoinColumn.javaField}) {\n    message.error(\'请选择一个${table.classComment}\')\n    return\n  }\n  formRef.value.open(type, id, props.${subJoinColumn.javaField})\n}\n\n/** 删除按钮操作 */\nconst handleDelete = async (id: number) => {\n  try {\n    // 删除的二次确认\n    await message.delConfirm()\n    // 发起删除\n    await ${simpleClassName}Api.delete${subSimpleClassName}(id)\n    message.success(t(\'common.delSuccess\'))\n    // 刷新列表\n    await getList()\n  } catch {}\n}\n#end\n#if ($table.templateType != 11)\n\n/** 初始化 **/\nonMounted(() => {\n  getList()\n})\n#end\n</script>\n', '1', '2024-12-15 07:32:09', '1', '2024-12-16 14:36:37', b'0');
INSERT INTO `ucg_code_template` (`id`, `project_id`, `template_name`, `template_description`, `template_type`, `template_type_value`, `file_type`, `file_path_expression`, `original_path`, `template_content`, `creator`, `create_time`, `updater`, `update_time`, `deleted`) VALUES (33, 1, 'vue3_api', 'vue3版本api实现', 'FRONT', 'VUE3', 'java', 'yudao-ui-${sceneEnum.basePackage}-vue3/src/api/${table.moduleName}/${table.businessName}/index.ts', 'codegen/vue3/api/api.ts.vm', 'import request from \'@/config/axios\'\n#set ($baseURL = \"/${table.moduleName}/${simpleClassName_strikeCase}\")\n\n// ${table.classComment} VO\nexport interface ${simpleClassName}VO {\n#foreach ($column in $columns)\n#if ($column.createOperation || $column.updateOperation)\n#if(${column.javaType.toLowerCase()} == \"long\" || ${column.javaType.toLowerCase()} == \"integer\" || ${column.javaType.toLowerCase()} == \"short\" || ${column.javaType.toLowerCase()} == \"double\" || ${column.javaType.toLowerCase()} == \"bigdecimal\")\n  ${column.javaField}: number // ${column.columnComment}\n#elseif(${column.javaType.toLowerCase()} == \"date\" || ${column.javaType.toLowerCase()} == \"localdate\" || ${column.javaType.toLowerCase()} == \"localdatetime\")\n  ${column.javaField}: Date // ${column.columnComment}\n#else\n  ${column.javaField}: ${column.javaType.toLowerCase()} // ${column.columnComment}\n#end\n#end\n#end\n}\n\n// ${table.classComment} API\nexport const ${simpleClassName}Api = {\n#if ( $table.templateType != 2 )\n  // 查询${table.classComment}分页\n  get${simpleClassName}Page: async (params: any) => {\n    return await request.get({ url: `${baseURL}/page`, params })\n  },\n#else\n  // 查询${table.classComment}列表\n  get${simpleClassName}List: async (params) => {\n    return await request.get({ url: `${baseURL}/list`, params })\n  },\n#end\n\n  // 查询${table.classComment}详情\n  get${simpleClassName}: async (id: number) => {\n    return await request.get({ url: `${baseURL}/get?id=` + id })\n  },\n\n  // 新增${table.classComment}\n  create${simpleClassName}: async (data: ${simpleClassName}VO) => {\n    return await request.post({ url: `${baseURL}/create`, data })\n  },\n\n  // 修改${table.classComment}\n  update${simpleClassName}: async (data: ${simpleClassName}VO) => {\n    return await request.put({ url: `${baseURL}/update`, data })\n  },\n\n  // 删除${table.classComment}\n  delete${simpleClassName}: async (id: number) => {\n    return await request.delete({ url: `${baseURL}/delete?id=` + id })\n  },\n\n  // 导出${table.classComment} Excel\n  export${simpleClassName}: async (params) => {\n    return await request.download({ url: `${baseURL}/export-excel`, params })\n  },\n## 特殊：主子表专属逻辑\n#foreach ($subTable in $subTables)\n#set ($index = $foreach.count - 1)\n#set ($subSimpleClassName = $subSimpleClassNames.get($index))\n#set ($subPrimaryColumn = $subPrimaryColumns.get($index))##当前 primary 字段\n#set ($subJoinColumn = $subJoinColumns.get($index))##当前 join 字段\n#set ($SubJoinColumnName = $subJoinColumn.javaField.substring(0,1).toUpperCase() + ${subJoinColumn.javaField.substring(1)})##首字母大写\n#set ($subSimpleClassName_strikeCase = $subSimpleClassName_strikeCases.get($index))\n#set ($subJoinColumn_strikeCase = $subJoinColumn_strikeCases.get($index))\n#set ($subClassNameVar = $subClassNameVars.get($index))\n\n// ==================== 子表（$subTable.classComment） ====================\n## 情况一：MASTER_ERP 时，需要分查询页子表\n#if ( $table.templateType == 11 )\n\n  // 获得${subTable.classComment}分页\n  get${subSimpleClassName}Page: async (params) => {\n    return await request.get({ url: `${baseURL}/${subSimpleClassName_strikeCase}/page`, params })\n  },\n## 情况二：非 MASTER_ERP 时，需要列表查询子表\n#else\n  #if ( $subTable.subJoinMany )\n\n  // 获得${subTable.classComment}列表\n  get${subSimpleClassName}ListBy${SubJoinColumnName}: async (${subJoinColumn.javaField}) => {\n    return await request.get({ url: `${baseURL}/${subSimpleClassName_strikeCase}/list-by-${subJoinColumn_strikeCase}?${subJoinColumn.javaField}=` + ${subJoinColumn.javaField} })\n  },\n  #else\n\n  // 获得${subTable.classComment}\n  get${subSimpleClassName}By${SubJoinColumnName}: async (${subJoinColumn.javaField}) => {\n    return await request.get({ url: `${baseURL}/${subSimpleClassName_strikeCase}/get-by-${subJoinColumn_strikeCase}?${subJoinColumn.javaField}=` + ${subJoinColumn.javaField} })\n  },\n  #end\n#end\n## 特殊：MASTER_ERP 时，支持单个的新增、修改、删除操作\n#if ( $table.templateType == 11 )\n  // 新增${subTable.classComment}\n  create${subSimpleClassName}: async (data) => {\n    return await request.post({ url: `${baseURL}/${subSimpleClassName_strikeCase}/create`, data })\n  },\n\n  // 修改${subTable.classComment}\n  update${subSimpleClassName}: async (data) => {\n    return await request.put({ url: `${baseURL}/${subSimpleClassName_strikeCase}/update`, data })\n  },\n\n  // 删除${subTable.classComment}\n  delete${subSimpleClassName}: async (id: number) => {\n    return await request.delete({ url: `${baseURL}/${subSimpleClassName_strikeCase}/delete?id=` + id })\n  },\n\n  // 获得${subTable.classComment}\n  get${subSimpleClassName}: async (id: number) => {\n    return await request.get({ url: `${baseURL}/${subSimpleClassName_strikeCase}/get?id=` + id })\n  },\n#end\n#end\n}\n\n', '1', '2024-12-15 07:32:09', '1', '2024-12-15 11:46:54', b'0');
