if ($javaType == \"String\")\n            #set ($dictMethod = \"getStrDictOptions\")\n        #elseif ($javaType == \"Boolean\")\n            #set ($dictMethod = \"getBoolDictOptions\")\n        #end\n        #if ( $column.id == $subJoinColumn.id) ## 特殊：忽略主子表的 join 字段，不用填写\n        #elseif ($column.htmlType == \"input\" && !$column.primaryKey)## 忽略主键，不用在表单里\n      <el-table-column label=\"${comment}\" min-width=\"150\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-input v-model=\"row.${javaField}\" placeholder=\"请输入${comment}\" />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"imageUpload\")## 图片上传\n      <el-table-column label=\"${comment}\" min-width=\"200\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <UploadImg v-model=\"row.${javaField}\" />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"fileUpload\")## 文件上传\n      <el-table-column label=\"${comment}\" min-width=\"200\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <UploadFile v-model=\"row.${javaField}\" />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"editor\")## 文本编辑器\n      <el-table-column label=\"${comment}\" min-width=\"400\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <Editor v-model=\"row.${javaField}\" height=\"150px\" />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"select\")## 下拉框\n      <el-table-column label=\"${comment}\" min-width=\"150\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-select v-model=\"row.${javaField}\" placeholder=\"请选择${comment}\">\n              #if (\"\" != $dictType)## 有数据字典\n                <el-option\n                  v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n                  :key=\"dict.value\"\n                  :label=\"dict.label\"\n                  :value=\"dict.value\"\n                />\n              #else##没数据字典\n                <el-option label=\"请选择字典生成\" value=\"\" />\n              #end\n            </el-select>\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"checkbox\")## 多选框\n      <el-table-column label=\"${comment}\" min-width=\"150\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-checkbox-group v-model=\"row.${javaField}\">\n              #if (\"\" != $dictType)## 有数据字典\n                <el-checkbox\n                  v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n                  :key=\"dict.value\"\n                  :label=\"dict.label\"\n                  :value=\"dict.value\"\n                />\n              #else##没数据字典\n                <el-checkbox label=\"请选择字典生成\" />\n              #end\n            </el-checkbox-group>\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"radio\")## 单选框\n      <el-table-column label=\"${comment}\" min-width=\"150\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-radio-group v-model=\"row.${javaField}\">\n              #if (\"\" != $dictType)## 有数据字典\n                <el-radio\n                  v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n                  :key=\"dict.value\"\n                  :label=\"dict.value\"\n                >\n                  {{ dict.label }}\n                </el-radio>\n              #else##没数据字典\n                <el-radio value=\"1\">请选择字典生成</el-radio>\n              #end\n            </el-radio-group>\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"datetime\")## 时间框\n      <el-table-column label=\"${comment}\" min-width=\"150\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-date-picker\n              v-model=\"row.${javaField}\"\n              type=\"date\"\n              value-format=\"x\"\n              placeholder=\"选择${comment}\"\n            />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #elseif($column.htmlType == \"textarea\")## 文本框\n      <el-table-column label=\"${comment}\" min-width=\"200\">\n        <template #default=\"{ row, $index }\">\n          <el-form-item :prop=\"`${$index}.${javaField}`\" :rules=\"formRules.${javaField}\" class=\"mb-0px!\">\n            <el-input v-model=\"row.${javaField}\" type=\"textarea\" placeholder=\"请输入${comment}\" />\n          </el-form-item>\n        </template>\n      </el-table-column>\n        #end\n    #end\n#end\n      <el-table-column align=\"center\" fixed=\"right\" label=\"操作\" width=\"60\">\n        <template #default=\"{ $index }\">\n          <el-button @click=\"handleDelete($index)\" link>—</el-button>\n        </template>\n      </el-table-column>\n    </el-table>\n  </el-form>\n  <el-row justify=\"center\" class=\"mt-3\">\n    <el-button @click=\"handleAdd\" round>+ 添加${subTable.classComment}</el-button>\n  </el-row>\n#else## 情况二：一对一，form\n  <el-form\n    ref=\"formRef\"\n    :model=\"formData\"\n    :rules=\"formRules\"\n    label-width=\"100px\"\n    v-loading=\"formLoading\"\n  >\n#foreach($column in $subColumns)\n  #if ($column.createOperation || $column.updateOperation)\n  #set ($dictType = $column.dictType)\n      #set ($javaField = $column.javaField)\n      #set ($javaType = $column.javaType)\n      #set ($AttrName = $column.javaField.substring(0,1).toUpperCase() + ${column.javaField.substring(1)})\n      #set ($comment = $column.columnComment)\n      #set ($dictMethod = \"getDictOptions\")## 计算使用哪个 dict 字典方法\n      #if ($javaType == \"Integer\" || $javaType == \"Long\" || $javaType == \"Byte\" || $javaType == \"Short\")\n        #set ($dictMethod = \"getIntDictOptions\")\n      #elseif ($javaType == \"String\")\n          #set ($dictMethod = \"getStrDictOptions\")\n      #elseif ($javaType == \"Boolean\")\n          #set ($dictMethod = \"getBoolDictOptions\")\n      #end\n      #if ( $column.id == $subJoinColumn.id) ## 特殊：忽略主子表的 join 字段，不用填写\n      #elseif ($column.htmlType == \"input\" && !$column.primaryKey)## 忽略主键，不用在表单里\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-input v-model=\"formData.${javaField}\" placeholder=\"请输入${comment}\" />\n    </el-form-item>\n      #elseif($column.htmlType == \"imageUpload\")## 图片上传\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <UploadImg v-model=\"formData.${javaField}\" />\n    </el-form-item>\n      #elseif($column.htmlType == \"fileUpload\")## 文件上传\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <UploadFile v-model=\"formData.${javaField}\" />\n    </el-form-item>\n      #elseif($column.htmlType == \"editor\")## 文本编辑器\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <Editor v-model=\"formData.${javaField}\" height=\"150px\" />\n    </el-form-item>\n      #elseif($column.htmlType == \"select\")## 下拉框\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-select v-model=\"formData.${javaField}\" placeholder=\"请选择${comment}\">\n              #if (\"\" != $dictType)## 有数据字典\n        <el-option\n          v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n          :key=\"dict.value\"\n          :label=\"dict.label\"\n          :value=\"dict.value\"\n        />\n              #else##没数据字典\n        <el-option label=\"请选择字典生成\" value=\"\" />\n              #end\n      </el-select>\n    </el-form-item>\n      #elseif($column.htmlType == \"checkbox\")## 多选框\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-checkbox-group v-model=\"formData.${javaField}\">\n              #if (\"\" != $dictType)## 有数据字典\n        <el-checkbox\n          v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n          :key=\"dict.value\"\n          :label=\"dict.label\"\n          :value=\"dict.value\"\n        />\n              #else##没数据字典\n        <el-checkbox label=\"请选择字典生成\" />\n              #end\n      </el-checkbox-group>\n    </el-form-item>\n      #elseif($column.htmlType == \"radio\")## 单选框\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-radio-group v-model=\"formData.${javaField}\">\n              #if (\"\" != $dictType)## 有数据字典\n        <el-radio\n          v-for=\"dict in $dictMethod(DICT_TYPE.$dictType.toUpperCase())\"\n          :key=\"dict.value\"\n          :label=\"dict.value\"\n          >\n          {{ dict.label }}\n        </el-radio>\n              #else##没数据字典\n        <el-radio value=\"1\">请选择字典生成</el-radio>\n              #end\n      </el-radio-group>\n    </el-form-item>\n      #elseif($column.htmlType == \"datetime\")## 时间框\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-date-picker\n        v-model=\"formData.${javaField}\"\n        type=\"date\"\n        value-format=\"x\"\n        placeholder=\"选择${comment}\"\n      />\n    </el-form-item>\n      #elseif($column.htmlType == \"textarea\")## 文本框\n    <el-form-item label=\"${comment}\" prop=\"${javaField}\">\n      <el-input v-model=\"formData.${javaField}\" type=\"textarea\" placeholder=\"请输入${comment}\" />\n    </el-form-item>\n      #end\n  #end\n#end\n  </el-form>\n#end\n</template>\n<script setup lang=\"ts\">\nimport { getIntDictOptions, getStrDictOptions, getBoolDictOptions, DICT_TYPE } from \'@/utils/dict\'\nimport { ${simpleClassName}Api } from \'@/api/${table.moduleName}/${table.businessName}\'\n\nconst props = defineProps<{\n  ${subJoinColumn.javaField}: undefined // ${subJoinColumn.columnComment}（主表的关联字段）\n}>()\nconst formLoading = ref(false) // 表单的加载中\nconst formData = ref([])\nconst formRules = reactive({\n#foreach ($column in $subColumns)\n    #if (($column.createOperation || $column.updateOperation) && !$column.nullable && !${column.primaryKey})## 创建或者更新操作 && 要求非空 && 非主键\n        #set($comment=$column.columnComment)\n  $column.javaField: [{ required: true, message: \'${comment}不能为空\', trigger: #if($column.htmlType == \'select\')\'change\'#else\'blur\'#end }],\n    #end\n#end\n})\nconst formRef = ref() // 表单 Ref\n\n/** 监听主表的关联字段的变化，加载对应的子表数据 */\nwatch(\n  () => props.${subJoinColumn.javaField},\n  async (val) => {\n    // 1. 重置表单\n#if ( $subTable.subJoinMany )\n    formData.value = []\n#else\n    formData.value = {\n    #foreach ($column in $subColumns)\n      #if ($column.createOperation || $column.updateOperation)\n        #if ($column.htmlType == \"checkbox\")\n      $column.javaField: [],\n        #else\n      $column.javaField: undefined,\n        #end\n      #end\n    #end\n    }\n#end\n    // 2. val 非空，则加载数据\n    if (!val) {\n      return;\n    }\n    try {\n      formLoading.value = true\n#if ( $subTable.subJoinMany )\n      formData.value = await ${simpleClassName}Api.get${subSimpleClassName}ListBy${SubJoinColumnName}(val)\n#else\n      const data = await ${simpleClassName}Api.get${subSimpleClassName}By${SubJoinColumnName}(val)\n      if (!data) {\n        return\n      }\n      formData.value = data\n#end\n    } finally {\n      formLoading.value = false\n    }\n  },\n  { immediate: true }\n)\n#if ( $subTable.subJoinMany )\n\n/** 新增按钮操作 */\nconst handleAdd = () => {\n  const row = {\n#foreach ($column in $subColumns)\n    #if ($column.createOperation || $column.updateOperation)\n      #if ($column.htmlType == \"checkbox\")\n    $column.javaField: [],\n      #else\n    $column.javaField: undefined,\n      #end\n  #end\n#end\n  }\n  row.${subJoinColumn.javaField} = props.${subJoinColumn.javaField}\n  formData.value.push(row)\n}\n\n/** 删除按钮操作 */\nconst handleDelete = (index) => {\n  formData.value.splice(index, 1)\n}\n#end\n\n/** 表单校验 */\nconst validate = () => {\n  return formRef.value.validate()\n}\n\n/** 表单值 */\nconst getData = () => {\n  return formData.value\n}\n\ndefineExpose({ validate, getData })\n</script>\n', '1', '2024-12-17 21:48:50', '1', '2024-12-17 21:48:50', b'0');
